import React from "react";
import { NavLink } from "react-router-dom";

export function Pokemon({ name, img, types, attack }) {
  return (
    <div>
      <NavLink to="/pokemons/:id">
        <h1>{name}</h1>
      </NavLink>
      <img src={img} alt="img" />
      <p>{types}</p>
    </div>
  );
}
export default Pokemon;
